r=new A.FO(A.Cg(""),A.u2(A.b([A.ah(["bobbi brown","In 1991, Bobbi Brown was founded by a female makeup artist in New York, designed for the world--your world.  We offer approachable artistry and create beauty must-haves that look good, work hard, and stay fresh every hour of the day.We remain women-first, champions of individual beauty, original owners of healthy, glowing skin, with the most premium products and effortless artistry, and expanding the brand and line in a way that is even more relevant to today\u2019s consumer.","bumble and bumble","Bumble and bumble began as an New York City salon in 1977, where we clipped, colored, and styled our way into prominence \u2013 with a strong design aesthetic and extraordinary products; in magazines, on runways, and backstage worldwide. Bumble and bumble has over 40+ years of salon industry expertise, owns and operates two leading flagship salons in NYC, and has salon partnerships with over 1500 independently owned salons all across North America.\nBumble and bumble is inspired by masters of the craft: hairstylists and colorists obsessed with technical and artistic excellence through bold self-expression. Bumble and bumble invents products to meet these professional, exacting standards that are also easy enough for anyone to use: from the iconic wave-enhancing Surf Spray to the best-selling mega-moisturizing Hairdresser's Invisible Oil range. These well-loved products are used by pros in Bumble and bumble salons and by millions of people around the world at home every day. Bumble and bumble creates products for all hair types, textures, and style preferences with uncompromising quality to instantly elevate your personal style with an effortlessly modern look. We are deeply, passionately, and fearlessly dedicated to the craft of hair.","by terry","Terry de Gunzburg is a trailblazing industry legend who over the course of the past 30 years has changed the face of beauty.\nTrading a career in medicine for a more creative life, Terry studied at the Carita beauty school in Paris and quickly became an in-demand makeup artist working with some of the biggest names in fashion. Her trademark beauty look has always been distinctive: imperceptible foundation, impeccable lips and thick, separated lashes.\nAs International Makeup Designer of YSL Beaut\xe9 for 15 years, Terry invented the iconic Touch\xe9 Eclat in 1992 (as well as countless other products and formulas). Radiance and a healthy complexion has always been key to Terry\u2019s approach to make up, and so she decided to launch her own collection of products in 1998, and BY TERRY was born.\nIn 2004 after a mix up in the lab, double the amount of rose butter was added to a lip balm which would soon become BY TERRY\u2019s most successful product: Baume de Rose. Described as the Rolls Royce of lip balms, it symbolizes everything the brand stands for\u2014luxury, indulgence and a timelessness.\nAlmost 10 years ago, before hyaluronic acid was widely known by households worldwide, Terry created the first clean mattifying setting powder, the Hyaluronic Hydra-Powder. This was the start of Terry\u2019s one of a kind Hyaluronic Range. We remain today pioneers of this ingredient and its applications.","byredo","Byredo is a European luxury brand founded in Stockholm in 2006 by Ben Gorham, with an ambition to translate memories and emotions into products and experiences.\nByredo is reinventing the world of luxury through a new approach, where creation is led by emotions, expressing a full and limitless brand universe.\nByredo conceives objects using the highest quality materials available, and high-end design details to fuel a renewed approach to modern luxury.\nByredo creates and develops a range of products such as fragrance, makeup, home, leather goods and accessories, and is sold in more than 40 countries in a very high-end exclusive network worldwide. We believe that through creativity, we are able to develop timeless products, both meaningful and inspirational, to people and their lives.\nA native Swede, born to an Indian mother and a Canadian father, Ben grew up in Toronto, New York and Stockholm. He graduated from the Stockholm art school with a degree in fine arts, but a chance meeting with perfumer Pierre Wulff convinced him that he'd rather create fragrances than paintings. With no formal training in the field, Gorham, 31 years old , sought out the services of world renowned perfumers Olivia Giacobetti and Jerome Epinette, explaining his olfactory desires and letting them create the compositions. As an outsider in the beauty industry, Ben is somewhat of an anomaly and has been recognized for his personal style and connection to fashion and art in several international magazines such as French Vogue, Vanity Fair, Elle, V Magazine and Fantastic Man to name a few.","diptyque","For Diptyque, creating fragrances is an art and art is a journey. An imaginary journey of the mind and the senses across olfactory landscapes, far from the paths that others take, in search of rare raw materials and unexpected accords. A journey between the past and the future, between tradition and the avant-garde, toward another place where history, new ideas, and disruption combine.\nDiptyque is always in between two worlds, finding its balance between dreams and reality, free from traditional gender codes or cultural boundaries, committed to developing connections and blends that nourish its inspiration. It is a creator of essences and images where the eye, the hand, and the nose are united to constantly revisit the surprising world of Haute Parfumerie.","estee lauder","Est\xe9e Lauder is the flagship brand of The Est\xe9e Lauder Companies Inc. Founded by Est\xe9e Lauder, one of the world\u2019s first female entrepreneurs, the brand today continues her legacy of creating the most innovative, sophisticated, high-performance skin care and makeup products and iconic fragrances \u2014 all infused with a deep understanding of women\u2019s needs and desires. Today Est\xe9e Lauder engages with women in over 150 countries and territories around the world and at a variety of touch points, in stores and online. And each of these relationships consistently reflects Est\xe9e\u2019s powerful and authentic woman-to-woman point of view.\nIn 1946, Mrs. Est\xe9e Lauder started with four cremes and a dream. With grit and persistence, she paved her own way in the beauty industry\u2014going from selling her cremes in salons to selling them on the shelves of stores around the world.\nAt a time when the beauty industry was ruled by men, Est\xe9e was the original girl boss, breaking glass ceilings and defying expectations at every turn. She was a true influencer, connecting with and giving honest, real-world beauty advice to women around the world.\nHer life\u2019s passion was to make everyone look and feel their most beautiful, and it\u2019s this same spirit and high-touch experience that we strive to bring to every customer today.","eve lom","A luxury British skincare brand founded by the most celebrated facialist of her time, EVE LOM embodies decades of skincare mastery in a curated collection of sensorial, high-performance products \u2014 including the cult-favourite Cleanser that has remained a coveted bestseller for over 35 years.","kevyn aucoin cosmetics","Kevyn Aucoin Beauty was founded in 2001 by one of the most iconic and influential makeup artists of all time. In the 90s, Kevyn became the first celebrity makeup artist with clients like Cindy Crawford, Naomi Campbell, Kate Moss, Cher, Whitney Houston, Madonna, Liza Minelli, Barbara Streisand, Tina Turner, and Jennifer Lopez. He perfected and brought fame to many iconic makeup techniques like contouring and the \u201cJ.Lo glow\u201d leading him to become the first-ever makeup artist to receive a CFDA Award .\nKevyn tragically passed away in 2002, but not before launching his legacy brand\u2013 Kevyn Aucoin Beauty, where Kevyn\u2019s spirit lives on today: It\u2019s unapologetic, brave, and rather quite fearless.\nKevyn believed that every woman is beautiful within, and makeup was simply his tool for helping her discover that beauty. He was a man and an artist decades ahead of his time, which paved the way for innovative, award-winning products, high-performance formulas, and textures.\nHis luxurious textures and expansive shade ranges have had a broad appeal globally for 20 years, when most brands had a limited shade range. He was a true industry pioneer who championed inclusivity, originality, empowerment and education, which remain pillars of the brand today.","maison margiela",'Maison Margiela is a Parisian haute couture house founded on ideas of nonconformity and the subversion of norms. Appointed Creative Director in 2014, the British couturier John Galliano exercises his visual language to expand on the grammar of Maison Margiela, creating a new technical vocabulary that cements the house\u2019s position as a singular and autonomous entity in the realm of luxury.\nIn 1994, Maison Margiela introduced the first "REPLICA" fashion pieces: garments and accessories hand-picked throughout the world and meticulously reproduced, preserving their character and charm. Each piece features a special label inside, describing the source and period of the original item.\nIn 2012, Maison Margiela expanded on this unique concept with a collection of fragrances: the scents your memories are made of. The "REPLICA" collection assembles iconcolast fragrances that have the universal power to trigger personally cherished moments, personal stories lived or to be lived.',"r+co","R+Co is a collective of some of the most forward-thinking, rule-bending hairstylists in the business. We are a think tank of top editorial and salon stylists and educators\u2014with a combined century of hairdressing knowledge and experience\u2014and we make sure that we have more than one viewpoint on everything we do.\nR+Co is about an experience. The packaging and fragrances were designed to enhance that experience and evoke a feeling, place, style or attitude. You\u2019ll know just by looking at a bottle or tube what a product is meant to do, and the subtle yet sophisticated fragrances\u2014meant for both men and women.\nOur award-winning line of haircare products feature unique ingredients and benefits designed to deliver immediate, high-performing results while keeping hair and scalp health at top-of-mind. All our formulas are color-safe, heat and UV protective, vegan, cruelty and gluten-free, and without harmful ingredients such as parabens, sulfates (SLS or SLES), mineral oil and petrolatum.","r+co bleu","R+Co BLEU is the couture-caliber capsule collection from R+Co. Combining modernity and style with breakthrough innovations in formulation, sustainability and iconic packaging design, this new range brings glamour, sophistication, and unparalleled quality to daily hair care.\nR+Co BLEU is informed by the keen editorial eye, artist\u2019s craft, and incomparable authority of R+Co\u2019s collective: a group of the industry\u2019s most trend-setting hairstylists and colorists, who, with over a century of experience among them, are responsible for creating many of pop culture\u2019s most iconic looks and needle-moving fashion moments.\nBased on a collaborative approach to hairdressing and product creation, R+Co leans on the distinct points of view of its world-class artists. Each stylist\u2019s unique perspective leading the product and images that are part of their signature. Garren\u2019s five-decade storied career and an ability to translate high fashion fantasy for the real world inspired the timeless beauty of BLEU. The resulting high-performance essentials give clients the ability to confidently create fashion-forward signature styles with everyday ease.","revive","A high-performance, luxury skincare line developed by plastic and reconstructive surgeon Dr. Gregory Bays Brown in 1997. R\xe9Vive formulas unlock the power of Bio-Renewal Technology, a cutting edge science, which visibly transforms renews, restoring skin to a younger, healthier, more supple version of itself. This collection of bio-engineered, skin-identical peptides mimic your own bio-renewal process to help restore skin's youthful glow.","rms beauty","A pioneer of the clean beauty movement, Rose-Marie Swift is the founder and the spirit of the brand. A master makeup artist for over 30 years, her lightbulb moment was realizing that cosmetics could be made with better, safer ingredients while simultaneously making women more beautiful. Bold, authentic, and unwavering in her quest for innovative clean ingredients that perform, she launched RMS in 2009 to clean up the industry and set a higher standard for beauty.\nIf you know...you know. Just ask the world\u2019s top supermodels and a community of loyal followers who have worn RMS for over a decade. As a professional makeup artist, it was important to Rose-Marie that RMS products were not only safe to use but could also be beautiful and long-lasting on a photo shoot, a runway show, and, of course, every day.\nRMS products are simple to understand, easy to use, and showcase the need for pure, simple, plant-based, skin-loving ingredients - and the beauty of radiant, glowing, natural human skin.","smashbox","Everyone has a story. Ours is original and authentic and sets us apart from every other beauty brand. We're proud of our story, and this is how we tell it: We live for lipstick. We get excited about primers. (No, seriously, we do.) But mostly, we love sharing our makeup secrets with you. Why? Because creativity and collaboration are at the core of our DNA. We are the only brand born out of a legendary photo studio \u2014 Smashbox Studios in Los Angeles \u2014 where major photographers, celebrities and makeup artists converge to create iconic images every day. Studio-tested, shockingly high-performance. Longwearing and skincaring. Artistry made easy. Hardworking makeup that keeps up with you.","susanne kaufmann","Proven holistic skincare powered by natural actives, responsibly sourced and produced in the Alpine regions of Austria & Switzerland.\nAn early pioneer of the natural beauty industry, our founder Susanne Kaufmann is an expert in holistic skincare and local ingredients. Susanne's deep connection to nature influences our core values of innovation, sustainability, and wellness- guiding every formula that she creates and reflecting our spa heritage in the heart of the Bregnerwald.\nUsing locally sourced, natural active ingredients from the Alpine regions of Austria and Switzerland, we develop intelligent ingredient complexes to power our clinically proven, efficacious formulas.","ab",u.b],s,s)],t.m0),t.GU),A.b([],t.EH),A.hK(null,null,null,t.X,t.xW),new A.iB(r),new A.iB(r),!1,!1)
